import * as React from 'react';
import { Button, View } from 'react-native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';

import MainDrawer from "./src/screens/MainDrawer";

const Drawer = createDrawerNavigator();

export default function DrawerNavigate() {
  return (
    <NavigationContainer>
      <Drawer.Navigator>
        <Drawer.Screen
          name="MainScreen"
          component={Main}
          options={{title: 'Главная'}}
          />
        <Drawer.Screen
            name="ExcercisesScreen"
            component={Excercises}
            options={{title: 'Виды упражнений'}}
            />
        <Drawer.Screen
            name="ExcerciseTypeScreen"
            component={ExcerciseType}
            options={{title: 'Упражнение'}}
            />
        <Drawer.Screen
            name="LoginScreen"
            component={Login}
            options={{title: 'Авторизация'}}
            />
        <Drawer.Screen 
            name="MainDrawer" 
            component={MainDrawer} 
            />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
